applyNoise= (value) => {

return value += (Math.random() - .5) *.000000000001


}


multiVariateNormal = (model,index,observation) =>
{
let cov = math.matrix(model[index]["cov"]);
let mean = math.matrix(model[index]["mean"]);
let x = math.matrix(observation)


let offset = math.subtract(x,mean);
let offsetTranspose = math.transpose(offset)
let covInverse = math.inv(cov);
let k = observation.length;

expTerm = math.multiply(-.5, offsetTranspose , covInverse, offset);
numerator = math.exp(expTerm)


covDet = math.det(math.map(cov, applyNoise))
denomCoefficient = math.pow(math.multiply(2, math.pi),k)
denominator = math.sqrt(denomCoefficient * covDet)
return numerator / denominator
}

let hOffset = canvas.offsetLeft;
let vOffset = canvas.offsetTop;
let ctx = canvas.getContext('2d')
ctx.imageSmoothingEnabled = false;


let pixelImage = ctx.createImageData(1,1);
pixelImage.data[0]   = 0;
pixelImage.data[1]   = 0;
pixelImage.data[2]   = 0;
pixelImage.data[3]   = 255;

let values = []
for (i = 0; i < 30; i ++)
{
    row = []
    for (c = 0; c < 30; c++)
    {
      row.push(0)   
    }
    values.push(row)
}

clearValues = () => {
    for (i = 0; i < 30; i ++)
    {
        for (c = 0; c < 30; c++)
        {
         values[i][c] = 0 
        }
    values.push(row)
} 
}



// for now we will do this inefficiently. There are 60 features, the sum of each row and sum of each column
getFeatures = () => {
    let features = []
    for (i = 0; i < 30; i ++)
    {
        let sum = 0
        for (c = 0; c < 30; c++)
        {
         sum += values[i][c]
        }
        features.push(sum)
    } 
    for (i = 0; i < 30; i ++)
    {
        let sum = 0
        for (c = 0; c < 30; c++)
        {
         sum += values[c][i]
        }
        features.push(sum)
    } 
    return features
}


let pressed = 0;
document.body.onmousedown = function() { 
 pressed = 1;
}
document.body.onmouseup = function() {
  pressed = 0
}



canvas.addEventListener('mousemove', function(event) { 
    if (pressed)
    {
    let x = (event.pageX - hOffset) /5,
        y = (event.pageY - vOffset) /5;
        ctx.putImageData( pixelImage,x, y);
        values[parseInt(x)][parseInt(y)] = 1
    }

}, false);
